import React from "react";
import Navbar from "./Navbar";
import Footer from "./Footer";

// Sample data for technical skills
const skillsData = [
  { name: "JavaScript", proficiency: "Intermediate" },
  { name: "React", proficiency: "Intermediate" },
  { name: "Python", proficiency: "Beginner" },
  { name: "Node.js", proficiency: "Beginner" },
  { name: "HTML & CSS", proficiency: "Advanced" },
  { name: "SQL", proficiency: "Intermediate" },
  { name: "Git & GitHub", proficiency: "Intermediate" },
  { name: "Java", proficiency: "Beginner" },
];

const projectsData = [
  {
    name: "Portfolio Website",
    description: "A personal portfolio website to showcase my skills and projects.",
    link: "#",
  },
  {
    name: "Task Manager App",
    description: "A to-do list app built with React to help manage tasks.",
    link: "#",
  },
  {
    name: "Weather App",
    description: "A weather forecasting app using an API to get real-time data.",
    link: "#",
  },
];

const educationData = {
  degree: "Bachelor of Science in Computer Science",
  institution: "Iowa State University",
  year: "Expected Graduation: 2025",
};

export default function Skills({ viewer, setViewer, isExpanded, setIsExpanded }) {
  const pageStyles = {
    fontFamily: "Arial, sans-serif",
    padding: "20px",
    backgroundColor: "#f5f5f5",
  };

  const sectionTitleStyles = {
    color: "#2c3e50",
  };

  const introStyles = {
    marginBottom: "30px",
  };

  const skillsListContainerStyles = {
    display: "flex",              // Use flexbox to center the grid container
    justifyContent: "center",     // Center the grid container horizontally
    alignItems: "center",         // Center the grid container vertically (if needed)
    margin: "0 auto",             // Center the grid container itself
    maxWidth: "1200px",           // Max width for the container (adjust if necessary)
    width: "100%",                // Ensure it takes up full available width
  };

  const skillsListStyles = {
    display: "grid",
    gridTemplateColumns: "repeat(auto-fill, minmax(250px, 1fr))",  // Responsive columns
    gap: "20px",
    justifyItems: "center",       // Ensures items are centered when they don't fill the row
    width: "100%",                // Ensures the grid stretches across available width
  };

  const skillItemStyles = {
    backgroundColor: "white",
    padding: "20px",
    borderRadius: "10px",
    boxShadow: "0 4px 6px rgba(0, 0, 0, 0.1)",
  };

  const projectItemStyles = {
    backgroundColor: "white",
    padding: "20px",
    borderRadius: "10px",
    boxShadow: "0 4px 6px rgba(0, 0, 0, 0.1)",
  };

  const projectLinkStyles = {
    color: "#3498db",
    textDecoration: "none",
    fontWeight: "bold",
  };

  const projectLinkHoverStyles = {
    textDecoration: "underline",
  };

  const footerStyles = {
    marginTop: "50px",
    textAlign: "center",
    padding: "10px",
    backgroundColor: "#2c3e50",
    color: "white",
  };

  return (
    <div style={pageStyles}>
      <Navbar viewer={viewer} setViewer={setViewer} />

      <section style={introStyles}>
        <h1 style={sectionTitleStyles}>Skills</h1>
        <p>
          As a Junior Software Engineer at Iowa State University, I have developed strong technical skills through my coursework, personal projects, and hands-on experience.
        </p>
      </section>

      <section>
        <h2 style={sectionTitleStyles}>Technical Skills</h2>
        <div style={skillsListContainerStyles}>
          <div style={skillsListStyles}>
            {skillsData.map((skill, index) => (
              <div key={index} style={skillItemStyles}>
                <h3>{skill.name}</h3>
                <p>{skill.proficiency}</p>
              </div>
            ))}
          </div>
        </div>
      </section>

      <section>
        <h2 style={sectionTitleStyles}>Projects</h2>
        <div style={skillsListContainerStyles}>
          <div style={skillsListStyles}>
            {projectsData.map((project, index) => (
              <div key={index} style={projectItemStyles}>
                <h3>{project.name}</h3>
                <p>{project.description}</p>
                <a href={project.link} target="_blank" rel="noopener noreferrer" style={projectLinkStyles}>
                  View Project
                </a>
              </div>
            ))}
          </div>
        </div>
      </section>

      <section>
        <h2 style={sectionTitleStyles}>Education</h2>
        <p>
          <strong>{educationData.degree}</strong> from {educationData.institution}, {educationData.year}
        </p>
      </section>

      <footer style={footerStyles}>
        <Footer />
      </footer>
    </div>
  );
}
